// src/components/Footer.js
import React from 'react';

const Footer = () => {
    return (
        <footer style={{
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            padding: '1.5rem 0',
            backgroundColor: '#282c34',
            color: 'white',
            fontSize: '0.9rem'
        }}>
            <div style={{
                display: 'flex',
                gap: '1rem',
                marginBottom: '0.5rem'
            }}>
                <a href="https://github.com/yourusername" target="_blank" rel="noopener noreferrer" style={{ color: 'white', textDecoration: 'none' }}>GitHub</a>
                <a href="https://linkedin.com/in/yourusername" target="_blank" rel="noopener noreferrer" style={{ color: 'white', textDecoration: 'none' }}>LinkedIn</a>
                <a href="https://twitter.com/yourusername" target="_blank" rel="noopener noreferrer" style={{ color: 'white', textDecoration: 'none' }}>Twitter</a>
            </div>
            <div style={{ opacity: 0.8 }}>
                &copy; {new Date().getFullYear()} Your Name. All rights reserved.
            </div>
        </footer>
    );
};

export default Footer;
